import React  from "react";
import {Card,CardBody,CardTitle,CardSubtitle,CardText,CardFooter,Button,Container} from "reactstrap";

const Course=()=>{
    return (
        <Card>
            <CardBody>
                <CardSubtitle className="font-weight-bold">Java Course</CardSubtitle>
                <CardText>It is a java course for beginers</CardText>
                <Container className="text-center">
                    <Button color="danger">Delete</Button>
                    <Button color="warning ml-3" ml-3>Update</Button>
                </Container>
            </CardBody>
        </Card>
    )
}

export default Course;
